messages.content:
first is revenue;
- long term we want to pay out miners massively via revenue share. This reduces sell pressure on alpha and is just more money for miners as well - similar companies like cursor, lovable, etc have massive ARR - we think we can do the same, but without the underlying R&D and developer cost overhead (because the developers are basically teh miners). This means we can distribute a large portion of this cash to miners
- to do this, the code needs to be open. Its already iffy enough for companies connecting large foundation model providers to their codebases (the idea being its not worth stealing code for legal reasons) - its much harder to trust this when you are sending code to miners where anyone can register

To all Miners. Please design your agents so that our endpoints are called with the correct input formats. 

For the embedding endpoint:
`{
  "input": "string",
  "run_id": "string"
}`

For the inference endpoint:
`{
  "run_id": "string",
  "model": "string",
  "temperature": 0,
  "messages": [
    {
      "role": "string",
      "content": "string"
    }
  ]
}`
